import React, { Component } from 'react'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import { Link } from 'react-router-dom'

class HeaderComponent extends Component {
    render() {
        return (
            <header>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand>
                        <Link to="/">Birthday Calendar</Link>
                    </Navbar.Brand>
                    <Navbar.Collapse className="justify-content-end">
                        {!this.props.isUserAuthenticated && <Nav.Link href='/signup'>Get Started</Nav.Link>}
                        {!this.props.isUserAuthenticated && <Nav.Link href='/login'>Log In</Nav.Link>}
                        {this.props.isUserAuthenticated && <Navbar.Text>Welcome, TestFirstName</Navbar.Text>}
                        {this.props.isUserAuthenticated && <Nav.Link href='/logout'>Log Out</Nav.Link>}
                    </Navbar.Collapse>
                </Navbar>
            </header>
        )
    }
    
}

export default HeaderComponent
